-- Name: validate_branch_entity_hospital(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.validate_branch_entity_hospital() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Skip validation if branch_id is NULL
    IF NEW.branch_id IS NULL THEN
        RETURN NEW;
    END IF;
    
    -- Validate branch belongs to same hospital as entity
    IF NOT EXISTS (
        SELECT 1 FROM branches 
        WHERE branch_id = NEW.branch_id 
        AND hospital_id = NEW.hospital_id
    ) THEN
        RAISE EXCEPTION 'Security Violation: Entity cannot be assigned to branch from different hospital';
    END IF;
    
    RETURN NEW;
END;
$$;


