--
-- TOC entry 281 (class 1259 OID 165334)
-- Name: purchase_orders_view; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.purchase_orders_view AS
 SELECT po.po_id,
    po.hospital_id,
    po.branch_id,
    po.po_number,
    po.po_date,
    po.quotation_date,
    po.expected_delivery_date,
    EXTRACT(year FROM po.po_date) AS po_year,
    EXTRACT(month FROM po.po_date) AS po_month,
    to_char(po.po_date, 'YYYY-MM'::text) AS po_month_year,
    to_char(po.po_date, 'Q'::text) AS po_quarter,
    po.supplier_id,
    COALESCE(s.supplier_name, 'Unknown Supplier'::character varying) AS supplier_name,
    s.supplier_category,
    s.contact_person_name AS supplier_contact_person,
    (s.contact_info ->> 'mobile'::text) AS supplier_mobile,
    (s.contact_info ->> 'phone'::text) AS supplier_phone,
    s.email AS supplier_email,
    s.gst_registration_number AS supplier_gst,
    s.pan_number AS supplier_pan,
    s.payment_terms AS supplier_payment_terms,
    s.black_listed AS supplier_black_listed,
    s.status AS supplier_status,
    b.name AS branch_name,
    b.state_code AS branch_state_code,
    b.is_active AS branch_is_active,
    h.name AS hospital_name,
    h.license_no AS hospital_license_no,
    po.currency_code,
    po.exchange_rate,
    po.total_amount,
    (po.total_amount * COALESCE(po.exchange_rate, (1)::numeric)) AS total_amount_base_currency,
    po.status AS po_status,
        CASE
            WHEN ((po.status)::text = 'draft'::text) THEN 1
            WHEN ((po.status)::text = 'pending'::text) THEN 2
            WHEN ((po.status)::text = 'approved'::text) THEN 3
            WHEN ((po.status)::text = 'partially_received'::text) THEN 4
            WHEN ((po.status)::text = 'received'::text) THEN 5
            WHEN ((po.status)::text = 'cancelled'::text) THEN 6
            ELSE 7
        END AS status_order,
    po.approved_by,
    po.quotation_id,
        CASE
            WHEN (po.po_date IS NOT NULL) THEN (CURRENT_DATE - (po.po_date)::date)
            ELSE NULL::integer
        END AS days_since_po,
        CASE
            WHEN (po.expected_delivery_date IS NOT NULL) THEN (po.expected_delivery_date - CURRENT_DATE)
            ELSE NULL::integer
        END AS days_until_delivery,
        CASE
            WHEN (po.expected_delivery_date IS NULL) THEN 'No Delivery Date'::text
            WHEN ((po.expected_delivery_date < CURRENT_DATE) AND ((po.status)::text <> ALL ((ARRAY['received'::character varying, 'cancelled'::character varying])::text[]))) THEN 'Overdue'::text
            WHEN ((po.expected_delivery_date = CURRENT_DATE) AND ((po.status)::text <> ALL ((ARRAY['received'::character varying, 'cancelled'::character varying])::text[]))) THEN 'Due Today'::text
            ELSE 'On Track'::text
        END AS delivery_status,
    po.created_at,
    po.created_by,
    po.updated_at,
    po.updated_by,
    po.deleted_flag,
    lower((((((((COALESCE(po.po_number, ''::character varying))::text || ' '::text) || (COALESCE(s.supplier_name, ''::character varying))::text) || ' '::text) || (COALESCE(po.quotation_id, ''::character varying))::text) || ' '::text) || (COALESCE(s.contact_person_name, ''::character varying))::text)) AS search_text
   FROM (((public.purchase_order_header po
     LEFT JOIN public.suppliers s ON ((po.supplier_id = s.supplier_id)))
     LEFT JOIN public.branches b ON ((po.branch_id = b.branch_id)))
     LEFT JOIN public.hospitals h ON ((po.hospital_id = h.hospital_id)))
  WHERE (po.deleted_flag = false);


